import React, { Component } from 'react'

export default class tryConvert extends Component {

    render() {
        const input = parseFloat(this.props.temp);
        if (Number.isNaN(input)) {
            return '';
        }
        const output = this.props.tryConvert
        const rounded = Math.round(output * 1000) / 1000;
        return rounded.toString();
    }
}
